import { env } from 'node:process';

export const handleStartQuiz = async (page: string) => {

  console.log(env)

  let startQuizBaseUrl: string;

  if (process.env.NODE_ENV === 'production') {
    startQuizBaseUrl = 'https://darling-choux-63e4e8.netlify.app/.netlify/functions/express/start-quiz';
  } else {
    startQuizBaseUrl = 'http://localhost:8000/start-quiz';
  }

  console.log(`Start Quiz URL: ${startQuizBaseUrl}`);


  try {
    const response = await fetch(`${startQuizBaseUrl}`, {
      headers: {
        "Content-Type": "application/json",
      },
      credentials: "include",
    });
    if (response.ok) {
      window.location.href = page === "home" ? "/quiz" : "/";
    }
  } catch (error) {
    console.error("Error setting session data:", error);
  }
};
